import React, { Suspense } from "react";
import logo from "./logo.svg";
import "./App.css";
import { IntlProvider } from "react-intl";
import { BrowserRouter as Router, Switch, Redirect } from "react-router-dom";
import { ProtectedRoute } from "components/Auth/PrivateRoute.js";
import { adminRoot } from "./constants";

const ViewHome = React.lazy(() => import("./views/home"));
const Dashboard = React.lazy(() => import("./pages/Dashboard.js"));

function App() {
	return (
		<IntlProvider
			locale={currentAppLocale.locale}
			messages={currentAppLocale.messages}
		>
			<Suspense fallback={<div className="loading" />}>
				<Router>
					<Switch>
						<ProtectedRoute path={adminRoot} component={Dashboard} />
						<InversedWithAuth
							path="/user"
							render={(props) => <div>Heyy</div>}
						/>

						<Redirect to="/error" />
					</Switch>
				</Router>
			</Suspense>
		</IntlProvider>
	);
}

export default App;
